import React from 'react';

class Contact extends React.Component {
    constructor(props) {
      super(props);

    }

    render() {
          return (
              <div className="contactButton">
                  CONTACT US
                  <style jsx>
                      {`
                     
                      .contactButton {
                        font-family: Syncopate;
                        font-size: 1.5em;
                      }
                      
                      `}
                  </style>
              </div>
          )
      }
}

export default Contact;
